import { authActions } from "../actions/authActions"

const initState = {
    useDetails: null,

}

 const authreducer = (state = initState, action) => {
    switch (action.type) {
        case authActions.SET_USER_DETAILS:
            return {
                ...state,
                useDetails: action.useDetails,
            };
            default :
            return state;

    }
}

module.exports = reducer
